in vec2 vUv;
out vec4 fragColor;

uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

#define MAX_STEPS 100
#define MAX_DIST 100.0
#define SURF_DIST 0.001

// Gyroid formula
float sdGyroid(vec3 p, float scale, float thickness, float bias) {
    p *= scale;
    return abs(dot(sin(p), cos(p.zxy)) - bias) / scale - thickness;
}

// 3D rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Main Scene Distance Function
float map(vec3 p) {
    // Dynamic coordinate warping
    p.z += iTime * 0.5;

    // Twist effect
    p.xy *= rot(p.z * 0.2 + iTime * 0.1);

    // Recursive Gyroid Layers
    float g1 = sdGyroid(p, 2.5, 0.03, 0.5 * sin(iTime * 0.2));
    float g2 = sdGyroid(p + vec3(iTime * 0.1), 5.2, 0.02, 0.3);
    float g3 = sdGyroid(p - vec3(0.0, iTime * 0.2, 0.0), 10.4, 0.01, 0.1);

    // Subtract/Blend layers
    float d = max(g1, -g2);
    d = mix(d, g3, 0.3);

    return d;
}

// Raymarching Loop
float rayMarch(vec3 ro, vec3 rd) {
    float dO = 0.0;
    for(int i = 0; i < MAX_STEPS; i++) {
        vec3 p = ro + rd * dO;
        float dS = map(p);
        dO += dS * 0.8; // Relaxed step for smoother transitions
        if(dO > MAX_DIST || abs(dS) < SURF_DIST) break;
    }
    return dO;
}

// Calculate Normals
vec3 getNormal(vec3 p) {
    float d = map(p);
    vec2 e = vec2(0.01, 0);
    vec3 n = d - vec3(
        map(p - e.xyy),
        map(p - e.yxy),
        map(p - e.yyx));
    return normalize(n);
}

// Simple shading and coloring
void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 m = iMouse.xy / iResolution.xy;

    // Camera setup
    vec3 ro = vec3(0, 0, -1.0);
    vec3 rd = normalize(vec3(uv.x, uv.y, 1.0));

    // Mouse Interaction
    ro.yz *= rot(-m.y * 3.14 + 1.0);
    rd.yz *= rot(-m.y * 3.14 + 1.0);
    ro.xz *= rot(-m.x * 6.28);
    rd.xz *= rot(-m.x * 6.28);

    // Marching
    float d = rayMarch(ro, rd);

    vec3 col = vec3(0.0);

    if(d < MAX_DIST) {
        vec3 p = ro + rd * d;
        vec3 n = getNormal(p);
        vec3 r = reflect(rd, n);

        // Lighting
        float dif = dot(n, normalize(vec3(1, 2, 3))) * 0.5 + 0.5;
        float spec = pow(max(0.0, r.z), 32.0);

        // Color Palette based on position and normal
        vec3 baseCol = 0.5 + 0.5 * cos(vec3(0, 2, 4) + p.z * 0.5 + iTime * 0.4);
        vec3 accentCol = 0.5 + 0.5 * sin(vec3(3, 1, 5) + n.y * 2.0);

        col = baseCol * dif;
        col += accentCol * spec * 0.5;

        // Distance Fog
        col *= exp(-0.05 * d * d);
    }

    // Post-processing
    col = pow(col, vec3(0.4545)); // Gamma correction
    col *= 1.2; // Contrast

    // Subtle vignette
    float vignette = 1.0 - dot(uv, uv) * 0.4;
    col *= vignette;

    fragColor = vec4(col, 1.0);
}
